import React from "react";

export const Footer = () => {
    return (
        <>
            <div className="great-gatsby">
                <p>
                    In my younger and more vulnerable years my father gave
                    me some advice that I have been turning over in my mind
                    ever since. 
                    "Whenever you feel like criticizing any one, he told me,
                    just remember that all the people in this world have not had
                    the advantages that you have had."
                </p>
            </div>
            <div className="footer-links">
                <a href="https://en.wikipedia.org/wiki/The_Great_Gatsby">Gatsby</a>
                <br />
                <a href="https://www.gatsbyjs.com/">Another Gatsby</a>
            </div>
        </>
    );
};
